import React from "react";
import { Link } from "react-router-dom";
import {
  PageContainer,
  Title,
  Subtitle,
  Demo,
  Video,
} from "./styles/index_style.js";
import ReactPlayer from "react-player";
import landing_video from "../imgs/landing_video.mov";

function Home() {
  return (
    <PageContainer>
      {/* <Overlay /> */}
      <Title>Marview</Title>
      <Subtitle>The Future of Maritime Navigation</Subtitle>
      <Demo>Schedule a Demo</Demo>
      <Video autoPlay loop muted>
        <source src={landing_video} type="video/mov" />
      </Video>
    </PageContainer>
  );
}

export default Home;
